import React, { useState } from "react";
import SideBar from '../sideBar/sideBard';
import Avatar from './avatar/avatar';


export default function NavBar() {
  const [open, setOpen] = useState(false);
  const HandleOpen = () => {
    setOpen(!open);
  };

  return (
    <nav className="flex flex-row w-full mx-4 lg:mx-20  justify-between">
      <div>logo</div>
      <div>
        <Avatar HandleOpen={HandleOpen} />
        <SideBar open={open}/>
      </div>
    </nav>
  );
}
